import React from "react";
import "./FoodAndWine.css";
import { Tab, Row, Col } from "react-bootstrap";
import { ImSpoonKnife } from "react-icons/im";

const FoodAndWine = () => {
  return (
    <div>
      <div className="title">
        <Row>
          <Col xs={9}>
            <h2>
              Your opinion matters &nbsp;
              <ImSpoonKnife />
            </h2>
          </Col>
        </Row>
        <hr />
      </div>
    </div>
  );
};

export default FoodAndWine;
